    __index = function(t, k)
        local cache = rawget(t, k)
        if (not cache) then
            local Success, Result = pcall(function()
                return cloneref(game:GetService(k))
            end)

            if (Success) then
                rawset(t, k, Result)
                cache = Result
            end
        end
        return cache
    end
})

