-- For easier cleanup of ALL drawnings
Explorer.Drawn = {}
local function Drawing_new(class, ignore)
    local Drawn = Drawing.new(class)
    getmetatable(Drawn).__ignore = ignore -- Custom
    getmetatable(Drawn).__class = class
    table.insert(Explorer.Drawn, Drawn)

    Drawn.Transparency = Explorer.Hidden and 0 or 1

    return Drawn
end

local function f_WARN(message)
    warn(`[engo explorer] {message}`)
end

local function f_PRINT(message)
    print(`[engo explorer] {message}`)
end

local convertableCharacters = {
    ["\n"] = "\\n",
    ["\r"] = "\\r",
    ["\t"] = "\\t",
    ["\b"] = "\\b",
    ["\f"] = "\\f",
    ["\v"] = "\\v",
    ["\a"] = "\\a",
    ["\""] = "\\\"",
    ["\\"] = "\\\\",
}

for code = 1, 255 do
    convertableCharacters[string.char(code)] = "\\" .. code
end

local function shallowCopy(obj, seen)
    if type(obj) ~= 'table' then
        return obj
    end

    if seen and seen[obj] then
        return seen[obj]
    end

    local s = seen or {}
    local res = setmetatable({}, getmetatable(obj))
    s[obj] = res

    for k, v in pairs(obj) do
        res[shallowCopy(k, s)] = shallowCopy(v, s)
    end

    return res
end

local function purifyString(str, splitNull)
    str = string.gsub(str, "[\"\\\0-\31\127-\255]", convertableCharacters)

    if splitNull then
        return str:split("\0")[1]
    else
        return str:gsub("\0", "\\0")
    end
end

local function getObjectSize(object)
    local class = getmetatable(object).__class
    if class == "Text" then
        return object.TextBounds
    end
    return object.Size
end

local function isPositionOver(basePos, baseSize, pos)
    local X, Y = basePos.X + baseSize.X, basePos.Y + baseSize.Y

    return pos.X >= basePos.X and pos.Y >= basePos.Y and pos.X <= X and pos.Y <= Y
end

local function isPositionOverObject(pos, obj)
    local objPos = obj.Position
    local objSize = getObjectSize(obj)
    return isPositionOver(objPos, objSize, pos)
end

local function getGuiObjectsAtPosition(pos)
    local t = {}
    for i, v in next, Explorer.Drawn do
        local mt = getmetatable(v)
        if (mt.__active ~= false) then
            if (not mt.__ignore) then
                if (isPositionOverObject(pos, v)) then
                    table.insert(t, v)
                end
            end
        end
    end

    table.sort(t, function(a, b)
        return a.ZIndex > b.ZIndex
    end)

    return t
end

local function getGuiObjectsAtMouse()
    local mousePos = Service.UserInputService:GetMouseLocation()
    return getGuiObjectsAtPosition(mousePos)
end

-- base is the bigger one yes
local function isCompletelyInside(basePos, baseSize, pos, size)
    local topLeft = basePos
    local topRight = basePos + Vector2.new(baseSize.X, 0)
    local bottomLeft = basePos + Vector2.new(0, baseSize.Y)
    local bottomRight = basePos + baseSize

    return
        isPositionOver(pos, size, topLeft) and
        isPositionOver(pos, size, topRight) and
        isPositionOver(pos, size, bottomLeft) and
        isPositionOver(pos, size, bottomRight)
end

local function isCompletelyInsideObject(obj1, obj2)
    return isCompletelyInsideObject(obj1.Position, getObjectSize(obj1), obj2.Position, getObjectSize(obj2))
end

local _TEXT_SIZE_DRAWING = Drawing_new("Text", true)
local function getTextSize(text, size, font)
    _TEXT_SIZE_DRAWING.Visible = false
    _TEXT_SIZE_DRAWING.Text = text or ""
    _TEXT_SIZE_DRAWING.Size = size or 14
    if font then
        _TEXT_SIZE_DRAWING.Font = font
    end
    return _TEXT_SIZE_DRAWING.TextBounds
end
-- CLASSES

local RightClickMenu = {}
local ExplorerInstance = {}; ExplorerInstance.__index = ExplorerInstance
local ExplorerInstances = {}
local ScriptViewer = {}

(function()
    local ExplorerInstanceList = Explorer.InstanceList
    local InstanceOrderList = {}; Explorer.Order = InstanceOrderList


    function ExplorerInstance.new(instance: Instance)
        local self = {}
        setmetatable(self, ExplorerInstance)

        self.Instance = cloneref(instance)
        self.Id = instance:GetDebugId()

        self:init()

        return self
    end

    function ExplorerInstance:getDebug()
        return `[id={self.Id}, path={self.Instance:GetFullName()}, o-idx={self:getOrderedIndex()}]`
    end

    function ExplorerInstance:init()
        -- Make sure debug id is not taken in list
        for _, v in next, ExplorerInstanceList do
            if (v.Id == self.Id) then
                return f_WARN(`Attempt to init ExplorerInstance with duplicate id! {self:getDebug()}\nStack Traceback: {debug.traceback()}`)
            end
        end

        -- Set expanded to false
        self.Expanded = false

        -- Set children table
        self.Children = {}

        local parent = self.Instance.Parent
        if (compareinstances(game, parent)) then
            parent = nil
        end

        if parent then
            self.Parent = ExplorerInstances:get(parent)
            table.insert(self.Parent.Children, self)
        end

        -- Set connections table
        self.Connections = setmetatable({}, {__call = function(self, arg)
            table.insert(self, arg)
            return arg
        end})

        -- Destroy object when instance is destroyed
        self.Connections(self.Instance:GetPropertyChangedSignal("Parent"):Connect(function()
            self:destroy()

            if (self.Instance.Parent ~= nil) then -- move instance to new parent
                ExplorerInstance.new(self.Instance)
            end

            ExplorerInstances:updateAll()
        end))

        self.ChildAdded = self.Connections(self.Instance.ChildAdded:Connect(function(child)
            if self.Expanded then
                local ExpInst = ExplorerInstance.new(child)

                if (#self.Instance:GetChildren() > 0) then
                    self.Arrow.Visible = true
                else
                    self.Arrow.Visible = false
                end

                ExplorerInstances:updateAll()
            else
                self:displayUpdate()
            end
        end))

        self.NameUpdate = self.Connections(self.Instance:GetPropertyChangedSignal("Name"):Connect(function()
            self.Text.Text = self:getName()
        end))

        -- Calculate the index at which this instance should go
        local index = self:calculateIndex()

        -- Display stuff
        self:display()

        -- Insert it into the order list
        table.insert(InstanceOrderList, index, self)
        table.insert(ExplorerInstanceList, self)
    end

    function ExplorerInstance:destroy()
        -- Are we trying to destroy a previously destroyed obj?
        if self.Destroyed then
            return f_WARN(`Attempt to destroy a destroyed ExplorerInstance! {self:getDebug()}\nStack Traceback: {debug.traceback()}`)
        end

        if self.Selected then
            self:unselect()
        end

        if self.Expanded then
            self:unexpand()
        end

        for _, v in next, self.Connections do
            if v.Connected then
                v:Disconnect()
            end
        end

        self.Text:Destroy()
        self.Icon:Destroy()
        self.Arrow:Destroy()

        local children = self.Children
        if (#children > 0) then
            for i = #children, 1, -1 do
                children[i]:destroy()
            end
        end

        local parent = self:getParent()
        if (parent) then
            local parentChildren = parent.Children
            table.remove(parentChildren, table.find(parentChildren, self))

            if (#parentChildren == 0) then
                parent.Arrow.Visible = false
            end
        end

        self.Parent = nil

        table.remove(ExplorerInstanceList, self:getIndex())
        table.remove(InstanceOrderList, self:getOrderedIndex())

        self.Destroyed = true
    end

    function ExplorerInstances:get(instance: Instance)
        for i, v in next, ExplorerInstanceList do
            if (compareinstances(v.Instance, instance)) then
                return v
            end
        end
    end

    function ExplorerInstances:getFromDrawing(drawing, drawingName)
        for _, v in next, ExplorerInstanceList do
            if v[drawingName] == drawing then
                return v
            end
        end
    end

    function ExplorerInstance:getIndex()
        return table.find(ExplorerInstanceList, self)
    end

    function ExplorerInstance:getOrderedIndex()
        return table.find(InstanceOrderList, self)
    end

    function ExplorerInstance:getParent()
        return self.Parent
    end

    function ExplorerInstance:getChildren()
        return self.Children
    end

    function ExplorerInstance:getDescendants()
        local descendants = {}
        for _, child in next, self.Children do
            table.insert(descendants, child)
            if (#child.Children > 0) then
                local childDescendants = child:getDescendants()
                for _, descendant in next, childDescendants do
                    table.insert(descendants, descendant)
                end
            end
        end
        return descendants
    end

    function ExplorerInstances:updateAll()
        for i, v in next, InstanceOrderList do
            if i % 1000 == 0 then
                task.wait()
            end
            v:displayUpdate()
        end
    end

    -------------------------
    -- Display functions
    -------------------------

    function ExplorerInstance:display()
        self.Text  = Drawing_new("Text")
        self.Icon  = Drawing_new("Image")
        self.Arrow = Drawing_new("Image")

        self.Text.Text = self:getName()
        self.Text.Size = 17
        self.Text.Color = Color3.new(1, 1, 1)
        self.Text.Visible = true
        self.Text.ZIndex = MAIN_ZINDEX + 3

        self.Icon.Data = base64decode(Images[self.Instance.ClassName] or Images.Unknown)
        self.Icon.Size = Vector2.one * IMAGE_SIZE
        self.Icon.Visible = true
        self.Icon.ZIndex = MAIN_ZINDEX + 3

        self.Arrow.Data = base64decode(Images.ArrowRight)
        self.Arrow.Size = Vector2.one * IMAGE_SIZE
        self.Arrow.Visible = false
        self.Arrow.ZIndex = MAIN_ZINDEX + 3

        if (#self.Instance:GetChildren() > 0) then
            self.Arrow.Visible = true
        else
            self.Arrow.Visible = false
        end

        self:displayUpdate()
    end

    function ExplorerInstance:getName()
        if ExplorerOptions.UseClassNames then
            return self.Instance.ClassName
        end

        local Name = self.Instance.Name
        if ExplorerOptions.CleanNames then
            Name = purifyString(Name, true)
        end

        return Name
    end

    function ExplorerInstance:displayUpdate()
        -- Setting positions

        local textPosition = self:calculatePosition()
        local iconPosition = self:calculateIconPosition(nil, textPosition)
        local arrowPosition = self:calculateIconPosition(2, textPosition)

        self.Text.Position = textPosition
        self.Icon.Position = iconPosition
        self.Arrow.Position = arrowPosition
        if self.SelectionBox then
            self.SelectionBox.Position = textPosition
            self.SelectionBox.Size = self.Text.TextBounds
        end
    end

    function ExplorerInstance:select()
        if (self.Selected) then
            return self:unselect()
        end

        if Explorer.Selected then
            Explorer.Selected:unselect()
        end

        self.SelectionBox = Drawing_new("Square")
        self.SelectionBox.Color = Color3.new(0.572549, 0.925490, 0.980392)
        self.SelectionBox.Transparency = 1 - 0.65
        self.SelectionBox.ZIndex = MAIN_ZINDEX + 2
        self.SelectionBox.Visible = true
        self.SelectionBox.Position = self.Text.Position
        self.SelectionBox.Size = self.Text.TextBounds
        self.SelectionBox.Filled = true

        self.Selected = true

        Explorer.Selected = self
    end

    function ExplorerInstance:unselect()
        Explorer.Selected = nil
        self.SelectionBox:Destroy()
        self.SelectionBox = nil
        self.Selected = false
    end

    function ExplorerInstance:expand()
        if self.Expanded then
            self:unexpand()
            return
        end

        self.Expanded = true

        self.Arrow.Data = base64decode(Images.ArrowDown)

        -- Get Children
        local Children = self.Instance:GetChildren()

        -- Create Children
        for i, child in next, Children do
            ExplorerInstance.new(child)
        end

        if (#self.Instance:GetChildren() > 0) then
            self.Arrow.Visible = true
        else
            self.Arrow.Visible = false
        end
        
        ExplorerInstances:updateAll()
    end

    function ExplorerInstance:unexpand()
        if (not self.Expanded) then
            return f_WARN(`Attempt to unexpand unexpanded object! {self:getDebug()}`)
        end

        self.Expanded = false

        local children = self.Children
        for i = #children, 1, -1 do
            children[i]:destroy()
        end

        self.Arrow.Data = base64decode(Images.ArrowRight)
        if (#self.Instance:GetChildren() > 0) then
            self.Arrow.Visible = true
        else
            self.Arrow.Visible = false
        end

        self.Children = {}

        ExplorerInstances:updateAll()
    end

    function ExplorerInstance:displayRightClickMenu()
        if Explorer.RightClickMenu then
            local Inst = Explorer.RightClickMenu.ExplorerInstance
            Explorer.RightClickMenu:destroy()
            if Inst == self then
                return
            end
        end

        Explorer.RightClickMenu = RightClickMenu:new(self)
    end

    -------------------------
    -- Calculation functions
    -------------------------

    function ExplorerInstance:calculatePosition()
        local ViewportSize = Camera.ViewportSize

        -- Calculate X
        local InsetNumber = self:calculateInset()
        local Inset = (InsetNumber * INSET_SIZE) + START_INSET

        local PosX = (ViewportSize.X - SIZE_X) + Inset

        -- Calculate Y
        local TextBounds = self.Text.TextBounds
        local Index = self:calculateIndex()

        local PosY = (Y_OVERFLOW + ((Index - 1) * (TextBounds.Y + INSTANCE_TEXT_PADDING))) + (Explorer.ScrollOffset or 0)

        return Vector2.new(PosX, PosY)
    end

    function ExplorerInstance:calculateIconPosition(Multiplier, calculatedPosition)
        local Multiplier = Multiplier or 1
        local TextPosition = calculatedPosition or self:calculatePosition()
        local NewX = TextPosition.X - ((IMAGE_SIZE + IMAGE_TEXT_PADDING) * Multiplier)

        return Vector2.new(NewX, TextPosition.Y)
    end

    function ExplorerInstance:calculateIndex()
        local index = self:getOrderedIndex()
        if (index) then
            return index
        end

        local Parent = self:getParent()
        if (Parent) then
            local ParentIndex = Parent:calculateIndex()
            local ParentDescendants = Parent:getDescendants()
            return ParentIndex + #ParentDescendants
        else
            -- Its parent is the DataModel and its not already calculated, just return the next number
            return #ExplorerInstanceList + 1
        end
    end

    function ExplorerInstance:calculateInset()
        local instance = self.Instance
        for i = 1, 9e9 do
            instance = instance.Parent
            if instance == nil then
                return i
            end

            if compareinstances(instance, game) then
                return i
            end
        end
    end

    --[[
        function calculateMaximumY - get pixels that all of the instances take up

        The old implementation of this was inefficient asf (loop through and add textbounds+padding each time),
        for a function that could be called EVERY frame, it needs to be efficient
    ]]
    function ExplorerInstances:calculateMaximumY()
        local MaximumY = (#InstanceOrderList + 1) * (InstanceOrderList[1].Text.TextBounds.Y + INSTANCE_TEXT_PADDING)
        return MaximumY
    end
end)()

