    function RightClickMenu:newButton(name, callback)
        table.insert(self.Buttons, {
            Name = name,
            Callback = callback,
        })
    end

    function RightClickMenu:display()
        self.Background = Drawing_new("Square")
        self.Background.Color = Color3.fromHSV(0, 0.0, 0.1777)
        self.Background.ZIndex = MAIN_ZINDEX + 10
        self.Background.Filled = true

        for i, button in ipairs(self.Buttons) do
            button.Drawing = Drawing_new("Text")
            button.Drawing.Color = Color3.new(1, 1, 1)
            button.Drawing.Text = button.Name
            button.Drawing.Size = 17
            button.Drawing.Visible = true
            button.Drawing.ZIndex = MAIN_ZINDEX + 12
        end

        local Size = self:calculateSize()
        local MousePosition = Service.UserInputService:GetMouseLocation()

        self.Background.Size = Size
        self.Background.Position = MousePosition
        self.Background.Visible = true

        for i, button in ipairs(self.Buttons) do
            button.Drawing.Position = Vector2.new(MousePosition.X + (self.Background.Size.X / 2) - (button.Drawing.TextBounds.X / 2), MousePosition.Y + (i-1) * button.Drawing.TextBounds.Y)
        end
    end

    function RightClickMenu:destroy()
        self.Background:Destroy()
        for i, button in ipairs(self.Buttons) do
            button.Drawing:Destroy()
        end
        Explorer.RightClickMenu = nil
    end

    function RightClickMenu:calculateSize()
        local Y = #self.Buttons * (self.Buttons[1].Drawing.TextBounds.Y + INSTANCE_TEXT_PADDING)
        return Vector2.new(100, Y)
    end

    function RightClickMenu:getButton(drawing)
        for i, button in ipairs(self.Buttons) do
            if button.Drawing == drawing then
                return button
            end
        end
    end
end

-- Main Explorer
local function createExplorer()
    Explorer.Connections = setmetatable({}, {__call = function(self, arg)
        table.insert(self, arg)
        return arg
    end})

    local ViewportSize = Camera.ViewportSize
    local MainWindow = Drawing_new("Square")
    MainWindow.Visible = true
    MainWindow.ZIndex = MAIN_ZINDEX
    MainWindow.Color = Color3.new(0.141176, 0.141176, 0.141176)
    MainWindow.Filled = true
    MainWindow.Size = Vector2.new(SIZE_X, ViewportSize.Y)
    MainWindow.Position = Vector2.new(ViewportSize.X - SIZE_X, 0)

    Explorer.MainWindow = MainWindow

    Explorer.Connections(Camera:GetPropertyChangedSignal("ViewportSize"):Connect(function()
        local ViewportSize = Camera.ViewportSize
        MainWindow.Size = Vector2.new(SIZE_X, ViewportSize.Y)
        MainWindow.Position = Vector2.new(ViewportSize.X - SIZE_X, 0)
        ExplorerInstances:updateAll()
    end))

    Explorer.Connections(Service.UserInputService.InputBegan:Connect(function(input)
        if (input.KeyCode == ExplorerOptions.HideBind) then
            Explorer.Hidden = not Explorer.Hidden
            for i, v in Explorer.Drawn do
                v.Transparency = Explorer.Hidden and 0 or 1
            end

            return
        end


        -- This is actually awful
        if (input.UserInputType == Enum.UserInputType.MouseButton1) then
            local ObjectsClicked = getGuiObjectsAtMouse()
            for i, ObjectClicked in ObjectsClicked do
                local Button = Explorer.RightClickMenu and Explorer.RightClickMenu:getButton(ObjectClicked)
                if Button then
                    Button.Callback()
                    Explorer.RightClickMenu:destroy()
                    break
                end

                local Inst = ExplorerInstances:getFromDrawing(ObjectClicked, "Arrow")
                if Inst then
                    Inst:expand()
                    break
                end

                Inst = ExplorerInstances:getFromDrawing(ObjectClicked, "Text")
                if Inst then
                    Inst:select()
                    break
                end
            end
        elseif (input.UserInputType == Enum.UserInputType.MouseButton2) then
            local ObjectsClicked = getGuiObjectsAtMouse()
            for i, ObjectClicked in ObjectsClicked do
                local Inst = ExplorerInstances:getFromDrawing(ObjectClicked, "Icon")
                if Inst then
                    Inst:displayRightClickMenu()
                    return
                end

                Inst = ExplorerInstances:getFromDrawing(ObjectClicked, "Text")
                if Inst then
                    Inst:displayRightClickMenu()
                    return
                end
            end
        end
    end))

    Service.ContextActionService:BindCoreAction(
        "ExplorerScroll",
        function(action, state, input)
            local Objects = getGuiObjectsAtMouse()
            if (table.find(Objects, MainWindow)) then
                local Min = -((ExplorerInstances:calculateMaximumY()) - (MainWindow.Size.Y))
                Explorer.ScrollOffset = math.clamp(((Explorer.ScrollOffset or 0) + (input.Position.Z * SCROLL_SPEED)), Min + (Y_OVERFLOW * 2), Y_OVERFLOW)

                ExplorerInstances:updateAll()

                return Enum.ContextActionResult.Sink
            --[[elseif (Explorer.ScriptViewer and table.find(Objects, Explorer.ScriptViewer.SourceContainer)) then
                Explorer.ScriptViewer.ScrollOffset = (Explorer.ScriptViewer.ScrollOffset or 0) + (input.Position.Z * SCROLL_SPEED)
                Explorer.ScriptViewer:updateSource()]]
            end

            return Enum.ContextActionResult.Pass
        end,
        false,
        Enum.UserInputType.MouseWheel
    )

    -- Setup all current instances
    for i, v in next, game:GetChildren() do
        ExplorerInstance.new(v)
    end

    -- Fixes bugs related to ui staying when leaving with certain executors
    Explorer.Connections(Service.Players.PlayerRemoving:Connect(function(player)
        if (player ~= LocalPlayer) then return end

        for _, v in next, Explorer.Drawn do
            v.Visible = false
            v:Destroy()
        end

        Explorer.Drawn = nil
        Explorer = nil

        if cleardrawcache then
            cleardrawcache()
        end
    end))

    return Explorer
end

local function destroyExplorer()
    for _, v in next, Explorer.Connections do
        if v.Connected then
            v:Disconnect()
        end
    end

    for _, v in next, Explorer.Drawn do
        pcall(function()
            v:Destroy()
        end)
    end

    Service.ContextActionService:UnbindCoreAction("ExplorerScroll")

    getgenv().explorer = nil
end

Explorer.Destroy = destroyExplorer

